export default function Participant({ amanSteps }) {
  return (
    <div>
      <a href="https://www.flaticon.com/free-icons/man" title="man icons">
        Man icons created by Freepik - Flaticon
      </a>
      <div>Aman Singh</div>
      <div>{amanSteps}</div>
    </div>
  );
}
